"use strict";
var _demos = {
	salesoverview: require('syracuse-tablet/html/js/demos/salesoverview/main'),
	customers: require('syracuse-tablet/html/js/demos/customers/main')
};

exports.init = function() {
	for (var p in _demos) {
		try {
			_demos[p].register();
		} catch (e) {
			console.error("!!Error registering demo[" + p + "]", e.stack);
		}
	}
};